using Components;using System;using MessagePack;using HECSFramework.Serialize;using Commands;namespace HECSFramework.Core{	[MessagePackObject, Serializable]	public partial struct SphereComponentResolver : IResolver<SphereComponent>, IResolver<SphereComponentResolver,SphereComponent>, IData	{		public SphereComponentResolver In(ref SphereComponent spherecomponent)		{			return this;		}		public void Out(ref Entity entity)		{			var local = entity.GetComponent<SphereComponent>();			Out(ref local);		}		public void Out(ref SphereComponent spherecomponent)		{		}	}}